

CREATE DATABASE inventory

CREATE TABLE inventory (
    inventory_date DATE,
    unit_value DECIMAL(10,2),
    warehouse_latitude DECIMAL(9,6),
    warehouse_longitude DECIMAL(9,6),
    warehouse_country VARCHAR(100),
    warehouse VARCHAR(100),
    item VARCHAR(100),
    item_family VARCHAR(100),
    unit_of_measure VARCHAR(20),
    on_hand_quantity INT,
    outflow_quantity DECIMAL(10,2), -- Changed to DECIMAL as per provided data
    inflow_quantity INT,
    safety_stock_threshold_quantity INT,
    over_stock_threshold_quantity INT
);



